            for (int i = 0; i < 100; i++)
            {
                
                b[i] = int.Parse(Interaction.InputBox("Adjon meg egy 100 és 1000 közé eső értéket (ha nem esik bele az értelmezési tartományba, akkor nem kerül bele a listába)", "Mennyi az ára?"));
