                { 
                    lb_lista.Items.Add(b[i]);
                    a += b[i];
                }
                if (b[i] == 0)
                {
                    i = i + 100;
                }
                
            }
            la_vegosszeg.Text = a.ToString() + " Ft";
            int c = 0;
            c = a - (a % 5);
            la_fizetendoosszeg.Text = c.ToString() + " Ft";
